import "./content.css";
import City from "./city/city";
import HotelCategory from "./hotelCategory/hotelCategory";
const Content = () => {
  return (
    <div className="container mt-5">
      <City></City>
      <HotelCategory></HotelCategory>
    </div>
  );
};

export default Content;
